import StyledHeader from "../styles/StyledHeader";

const Header = () => {
  return (
    <StyledHeader>
      <h1>Hiawatha Comic Book Store</h1>
      <h3>Your digital comic book kiosk</h3>
    </StyledHeader>
  );
};

export default Header;
